import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <nav>
      <ul>
        <li>
          <NavLink to="/voitures">Voitures</NavLink>
        </li>
        <li>
          <NavLink to="/ajouter-voiture">Ajouter une voiture</NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
